import React, { Component } from "react";
import PropTypes from "prop-types";
import Item from './components/Item';

const ListInfo = ({ goods }) => (
    <ul className="ListInfo">
        {goods.map((value, index) => (
            <Item />
        ))}
    </ul>
)

export default ListInfo;
